    public void LoadCard(int cardID = 126441030)
    {
        Debug.Log(cardID);
        AssetBundle.UnloadAllAssetBundles(false);
        string cardStr = cardID.ToString();
        string cardFileStr = cardStr.Substring(0, 8) + "00";
        
        AssetBundle assetbundle = AssetBundle.LoadFromFile("D:\\DocFile\\Unity3dRef\\Assets\\SVExtract\\card_" + cardFileStr + ".unity3d");
        AssetBundle assetbundle1 = AssetBundle.LoadFromFile("D:\\DocFile\\Unity3dRef\\Assets\\SVExtract\\card_foiltextures.unity3d");
        AssetBundle assetbundle2 = AssetBundle.LoadFromFile("D:\\DocFile\\Unity3dRef\\Assets\\SVExtract\\card_shader_common.unity3d");
        cardStr = cardStr.Insert(8, "1");
        Material mat = assetbundle.LoadAsset<Material>(cardStr + "_M");

        if (mat != null)
        {
            //Material.Instantiate<Material>(material);
            plane.GetComponent<Renderer>().material = mat;
        }
        else{
            //plane.GetComponent<Renderer>().material = material;
        }
        AssetBundle.UnloadAllAssetBundles(false);
        return;
    }

    public void GoTo()
    {
        int id = int.Parse(IDtxt.text);
        Debug.Log(id);
        Viewer.NowId = Viewer.allCardIDs.IndexOf(id);
        LoadCard(id);
    }
    public void SetPrevCard()
    {
        Viewer.NowId -= 1;
        if (Viewer.NowId < 0)
        {
            Viewer.NowId = 0;
        }
        LoadCard(Viewer.allCardIDs[Viewer.NowId]);
    }

    public void SetNextCard()
    {
        Viewer.NowId += 1;
        if (Viewer.NowId >= Viewer.allCardNums) 
        {
            Viewer.NowId = Viewer.allCardNums - 1;
        }
        LoadCard(Viewer.allCardIDs[Viewer.NowId]);
    }
